(1, 'img/baiviet/wlop-21se.jpg', 'Đừng viết sách một mình', 'Phong cách sống', '<p><span style=\"font-family: Arial;\">Không phải ngẫu nhiên mà mình lại kêu gọi những thành viên trong Group Viết đi đừng sợ cùng viết chung một cuốn sách. Hơn 20 tác giả cùng nhau góp tên, về mặt tiến độ, cũng nhanh và gọn hơn đi một mình rất nhiều. Thêm nữa, chuyện những cây viết hoàn toàn mới chưa từng có kinh nghiệm đứng tên là “tác giả” chính là một bước tiến, một bước đệm các bạn tạo ra trong hành trình viết lách và tự hào đưa vào “portfolio” của riêng mình. Cuốn sách này được phát động viết từ tháng 10 và dự kiến sẽ chính thức được mở bán trước (pre-order) vào tháng 1/2022. </span></p><p><span style=\"font-family: Arial;\">Quay trở lại với chuyện của mình. </span></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 1217.2px;\" data-filename=\"M.JPG\"><br></p><p>Cuốn sách đầu tiên mình xuất bản năm 2016, cùng một người em và cũng là một đồng nghiệp, hai chị em viết chung sách về nghề. Gánh nặng và những hoang mang của lần đầu viết sách được bổ làm đôi, không thể gọi là thở phào, nhưng cũng giúp đi nhanh hơn nhiều. Bởi vì có người làm chung, chúng ta giữ nhau để không đi chệch hướng và cũng là để tăng sự cam kết của chính mình. </p><p>Năm ngoái mình coach cho một tác giả viết cuốn sách về lòng vị tha. Chị tha thiết và tâm huyết với nó sâu sắc. Ban đầu, chị định tự viết, đã viết được 1/3 nhưng liên tục chỉnh sửa và vì không nắm được quy trình viết cũng như không có người hướng dẫn, chị mất gần 1 năm dậm chân tại chỗ. Khi gặp mình và trò chuyện, mình phát hiện ra chị gặp khó khăn bởi vì quá ôm đồm trong khi chưa có kinh nghiệm cả viết lẫn chuyên môn trong chủ đề lựa chọn. Việc chị chọn mình đồng hành đã là một quyết định liên quan tới việc “không viết sách một mình” và giúp chị nhanh chóng hoàn thành bản thảo. Nhưng chưa dừng ở đó, trong quá trình viết, mình cũng khuyến khích chị nên tiếp cận và khai thác thêm các câu chuyện, góc nhìn của rất nhiều người khác. Tình cờ, chị gặp thêm một người có chung ý tưởng về chủ đề sách chị đang viết. Cả hai bắt tay với nhau, quyết định viết chung, cùng thực hiện một nghiên cứu để sau đó có chất liệu đưa vào sách. Bản thảo đó đã hoàn thành, được một nhà xuất bản đề xuất mua bản quyền và đang chờ xuất bản vào tháng 3/2022.</p><p>Tầm nhìn cho một cuốn sách thường khá rộng và người viết gặp khó khăn ở việc định hướng của họ. Khi có một người hỗ trợ hoặc đồng hành về mặt tầm nhìn và giám sát toàn bộ dự án, quá trình viết và hoàn thành bản thảo dễ dàng hơn.</p><p>Bên cạnh đó, bằng cách hợp tác, họ chia sẻ quyền sở hữu. Chia sẻ quyền sở hữu chẳng có gì là không hay, trong rất nhiều dự án mình đã làm, chia sẻ quyền sở hữu khiến dự án tốt hơn và nhanh hơn rất nhiều, đặc biệt là với những người mới. </p><p>Nửa cuối năm nay mình và Hạnh Nguyễn có tổ chức một thử thách là “100 ngày viết sách”. Thử thách này đòi hỏi người tham gia phải đặt cược với chính họ, hoàn thành viết một bản thảo trong 100 ngày, với sự đồng hành và hướng dẫn hoàn toàn miễn phí từ mình và Hạnh. Nhiều người nghe qua thì chùn bước, sợ mình không thể làm được. Nhưng những người tham gia thử thách không hề đi một mình, họ có những người bạn đi cùng và có người dẫn đường. Tất nhiên, vì đó là một “thử thách”, chuyện dẫn đường là một nhẽ, sự tự kỷ luật và cam kết mới là điều quan trọng. Và nhiều người không vượt qua được vì họ không có đủ sự cam kết, chứ không phải là họ không viết được nội dung! 5/12 người tham gia thử thách trong tháng 7 và 9 đã xong bản thảo của họ, chuẩn bị chờ xuất bản trong năm sau. Đây là “tỉ lệ” ngoài sức mong đợi của mình. Nó khiến mình càng có niềm tin vào chuyện “đừng viết sách một mình”. </p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 1217.2px;\" data-filename=\"civilization_by_wlop_dd92kba-fullview.jpg\"><br></p><p>2021 là năm mình làm việc với sách rất nhiều, nhiều bằng cả 10 năm trước cộng lại. Những người tìm đến mình để nhờ mình coach viết sách có (đã có 9 bản thảo được hoàn thành), người tìm đến để thuê mình chấp bút (book ghostwriting) cũng có (8 cuốn được ghostwriting), người rủ mình viết sách chung cũng có (năm nay mình đã xuất bản 2 cuốn đồng tác giả, còn một cuốn đang chờ và sẽ phát hành đầu năm sau) và chính mình đi kêu gọi mọi người viết chung dự án sách cũng có. </p><p>Khi nhìn lại những gì đã làm trong một năm qua, mình bất ngờ nhận ra mình đi nhanh hơn, làm được nhiều hơn bởi vì mình không-làm-nó-một-mình. Cả những người khác cũng vậy. Những tác giả trẻ, những cây viết mới, những người chưa bao giờ từng xuất bản thứ gì trước đó đã hoàn thành được sản phẩm của họ nhờ “đi cùng nhau” thay vì “đi một mình”. </p><p>Một cây viết không thể là chuyên gia về mọi thứ. Biết chấp nhận điểm yếu của mình và tìm kiếm một đối tác để giúp mình hoàn thành dự án là một tư duy cần thiết và thông minh. Cách tiếp cận này tạo ra cơ hội trải nghiệm để chúng ta làm việc cùng nhau, theo một cách sáng tạo và nhân văn. Bản thân việc đó thôi, cũng đã là một thành công lớn kể cả khi sách còn chưa lên kệ.</p><p>Bạn có đang ấp ủ viết một cuốn sách? Và bạn định làm nó một mình? </p>', '0', '0', '1', '2021-12-26 11:21:31', '2021-12-26 15:02:39', 'dung-viet-sach-mot-minh');
INSERT INTO `baiviet` (`MaBaiViet`, `HinhAnh`, `TieuDe`, `TenTag`, `NoiDung`, `LuotThich`, `BinhLuan`, `TrangThai`, `NgayTao`, `NgayCapNhat`, `DuongDan`) VALUES
(2, 'img/gioithieu/dd9qwx1-804b658b-56ee-4f68-aac4-af8ba1f08628.jpg', 'Những điều trường không dạy bạn về Marketing', 'Câu chuyện', '<p><span style=\"font-family: Arial;\">Tính đến thời điểm blog này được viết, mình đã làm trong ngành marketing được gần 2 năm. Đây là một thời gian không dài và mình còn rất rất, rất nhiều thứ phải học, nhưng mình rất hào hứng. Công nghệ và mạng internet đã đưa ngành marketing đến một thời kỳ mà mọi thứ đều thay đổi nhanh chóng và tất cả những phương pháp từng đúng trước đây trở nên khác đi. Và mình thực sự hào hứng khi liên tục được thử nghiệm, rút kinh nghiệm, thử nghiệm rồi lại rút kinh nghiệm để tìm cách làm chủ được sự vận động đó.</span></p><p><span style=\"font-family: Arial;\">Tốt nghiệp đại học ngành Fashion Design & Technology, mình ra trường và trở thành Phóng viên Thời Trang/Stylist cho một tạp chí. Gần 2 năm làm việc ở đây, công việc của mình gắn liền với chụp ảnh thời trang, viết bài, phỏng vấn người nổi tiếng, các sự kiện quảng bá và quan hệ với các thương hiệu. Những điều này đã cho mình một nhận thức thực tế về marketing, thương hiệu, hình ảnh, dư luận, truyền thông, và sự ham thích của mình với ngành marketing cũng bắt đầu từ đây.</span></p><p><span style=\"font-family: Arial;\">Làm tạp chí được gần 2 năm, mình quyết định nghỉ việc để đi học thạc sĩ ngành Fashion Marketing. Đây là thời gian để mình học về những khái niệm và quy trình cơ bản trong ngành marketing, nghe kinh nghiệm của các chuyên gia trong ngành, quan sát và tìm hiểu về các thương hiệu ở đất nước đang học. Sau khi tốt nghiệp, mình quay lại Sài Gòn và trở thành con mọt marketing. Trong tuần mình đi làm công việc marketing, cuối tuần viết blog, làm video, lên ý tưởng về nội dung, thời gian rảnh mình đọc và nghe thông tin về các nhãn hàng, mạng xã hội, những làn sóng mới trong tiêu thụ và đời sống. Marketing không phải tiếp thị. Marketing không phải quảng cáo. Marketing là văn hoá, là thói quen, là cuộc sống của mình.</span></p><p><span style=\"font-family: Arial;\">Và bài viết này là để chia sẻ với bạn những điều không được dạy ở trường, những điều mình quan sát được, những điều mình suy nghĩ.</span></p><p><span style=\"font-family: Arial;\">*LƯU Ý TO: Bài viết này không thay thế kiến thức cơ bản ở trường, không phải quy tắc marketing thời đại mới, không mang tính giáo dục, chỉ đơn thuần là chia sẻ 100% từ góc độ cá nhân.</span></p><p><span style=\"font-family: Arial;\"><b>1. HẦU HẾT CÁC CÔNG TY SẼ KHÔNG CÔNG NHẬN QUAN ĐIỂM MARKETING CỦA BẠN</b></span></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 1217.2px;\" data-filename=\"wl-op-4se.jpg\"><span style=\"font-family: Arial;\"><b><br></b></span></p><p><span style=\"font-family: Arial;\">Quan điểm marketing là gì: Nếu bạn đã và đang học, chắc chắn bạn biết những kênh quảng bá hiện có cũng như những chiến lược phổ biến, đúng không. Ai cũng biết là có quảng cáo TV, radio, biển hiệu, sự kiện, digital banners, celebs & influencers (một số gọi là KOL gì đó), mạng xã hội, vân vân. Nhưng tiền thì không phải vô tận và công ty nào cũng có con số ngân sách cho marketing, và tất nhiên con số này phải hạn chế ở mức mà người ta (tức ban lãnh đạo công ty) tính toán để doanh thu còn có lãi chứ. Thế thì giữa bạt ngàn sinh viên ngành marketing tốt nghiệp ra trường mà ai cũng nắm lý thuyết trong sách, ăn nhau là ở chỗ quan điểm marketing thế nào. Tức là trong các kênh marketing hiện có, cái nào chọn, cái nào bỏ qua, cái nào dồn nhiều lực, cái nào giữ ở mức sơ sơ, và thực hiện như thế nào để mang lại hiệu quả tối đa cho vốn đầu tư tối thiểu. Đó là quan điểm marketing.</span></p><p><span style=\"font-family: Arial;\">Quan điểm marketing của bạn, nếu bạn làm ở một công ty, sẽ được trình lên những cấp cao hơn, và trong hầu hết các trường hợp sẽ bị gạt đi không thương tiếc. Chuyện này xảy ra vì nhiều lý do khác nhau: có thể công ty đã quen với những cách làm cũ và quan điểm mới toanh của bạn làm cho ban quản trị cảm thấy không thoải mái, có thể ngân sách của công ty không thể đáp ứng những gì bạn đề ra, có thể người quản lý không thể lấy chính chức vụ và sự sống còn của họ trong công ty để đánh cược cho kế hoạch lạ lẫm của bạn, hoặc có thể, cũng có thể, kế hoạch đó thực sự chả ra gì cả.</span></p><p><span style=\"font-family: Arial;\">Khi ở trong trường hợp này, bạn có vài sự lựa chọn. Sự lựa chọn đầu tiên cũng là sự lựa chọn phổ biến nhất, là chấp nhận bỏ ý tưởng của mình, đơn thuần thực thi những chiến lược công ty yêu cầu, rồi đợi đến hết giờ làm phóng xe ra quán bia ngồi kêu ca về sự lỗi thời của ban quản trị và chém gió về tầm vóc của những chiến lược bạn đề ra hiện lại nằm trong thùng rác máy tính văn phòng. Sự lựa chọn thứ nhất này sau một thời gian thường sẽ dẫn đến sự lựa chọn thứ hai, là nghỉ việc, xin làm ở một công ty mới, nghe nói là trẻ, năng động và chịu khó đổi mới hơn. Để cuối cùng trong hầu hết mọi trường hợp là bạn lại cay đắng phát hiện ra rằng vẫn không ai thèm đếm xỉa đến quan điểm của bạn cả. Và rồi bạn lại theo lựa chọn thứ nhất.</span></p><p><span style=\"font-family: Arial;\">Đối với một số công ty, chiến lược giữ khách hàng ở lại là chính sách không bắt buộc khách hàng ở lại. Theo bạn, tại sao họ tại có chiến lược như vậy?</span></p><p><span style=\"font-family: Arial;\">Lựa chọn thứ 3 là bạn đẻ ra một đứa con tinh thần của riêng bạn, kiên quyết vận hành nó theo quan điểm marketing của bạn và chứng minh rằng mọi người không tin tưởng bạn là sai (hoặc đúng). “Đứa con tinh thần” ở đây có thể dao động từ những thứ không cần đến một đồng vốn như một cái blog, một kênh thông tin, một website cá nhân, cho đến những shop bán sản phẩm hoặc dịch vụ online. Và mình khuyến khích bạn theo lựa chọn này. Hãy cứ giữ công việc ban ngày để có miếng cơm bỏ miệng và tấm áo trên lưng, nhưng các buổi tối và cuối tuần hãy dùng chính quan điểm marketing của mình để market cho đứa con tinh thần ấy. Đây là cách tốt nhất để bạn nhanh chóng học hỏi, mày mò, trải nghiệm, làm sai, và rồi (hy vọng là) làm đúng. Để rồi kể cả nếu đứa con tinh thần đó không trở thành công việc toàn thời gian của bạn, thì bạn cũng có thể dùng nó làm bằng chứng cho quan điểm marketing đúng đắn của mình ở công ty tiếp theo. Thời đại số cho bạn cơ hội để sản xuất và quảng bá nội dung với chi phí gần như bằng 0. Bởi vậy thay vì trách công ty, trách đồng nghiệp, hãy suy nghĩ xem mình có thể làm gì để chứng minh rằng mình đúng.</span></p><p><span style=\"font-family: Arial;\"><b>2. BẠN KHÔNG CẦN PHẢI NGHE AI CẢ</b></span></p><p><span style=\"font-family: Arial;\">Nhân vật biểu tượng đứng phía ngoài một cửa hàng đồ chơi ở London. Bạn nghĩ tại sao người ta làm như vậy?</span></p><p><span style=\"font-family: Arial;\">Cái này chắc chắn người ta sẽ không nói với bạn ở trường, nhưng thực tế là như vậy. Bạn cần học những khái niệm căn bản, cần học cách quan sát và tư duy từ khía cạnh của một người làm marketing chứ không phải từ một người dùng, cần học cách vận hành của một công ty tiêu chuẩn, cần học từ các dẫn chứng của marketing thành công cũng như thất bại trong quá khứ. Trường học sẽ dạy cho bạn những cái đó, nhưng sẽ không ai có thể dạy bạn marketing như thế nào là đúng khi bạn đi làm. Khái niệm “Đúng” trong ngành marketing chính là kết quả mang lại. Và đôi khi kết quả này lại không đến ngay sau một mùa quảng bá. Có những quyết định marketing đơn thuần nhằm tăng doanh số mùa, nhưng cũng có những quyết định lùi một bước nhằm tiến nhiều bước về lâu dài. Bạn cần hết sức thận trọng khi cứ lao vào nghe “kinh nghiệm thành công” của những người được coi là “bậc thầy ngành marketing”, vì mục đích và hướng đi của mỗi doanh nghiệp/thương hiệu/cá nhân là khác nhau. Cái khó của ngành marketing là sự cân bằng mong manh giữa việc học hỏi từ những người đi trước và kiên quyết giữ ý kiến của mình, đòi hỏi bạn phải có một độ “lì”, đôi mắt liên tục quan sát và bộ não không ngừng phân tích tất cả những xu hướng xung quanh.</span></p><p><span style=\"font-family: Arial;\">Bạn có bất ngờ khi mình nói đây là nơi mua đồ Topman – một thương hiệu bình dân? Đây là phòng VIP trên tầng cao nhất toà nhà Topshop – Topman London với phòng thay đồ rộng, stylist riêng, bánh snack và trà để giới thiệu và bán dòng sản phẩm Topman Premium. Tại sao Topman lại đầu tư đẩy mạnh dòng sản phẩm premium trong khi rõ ràng Topshop mới chiếm đa số doanh thu mà lại không có Topshop Premium? Theo bạn là tại sao?</span></p><p><span style=\"font-family: Arial;\">Đó cũng là lý do mình không chia sẻ quan điểm marketing của mình, trừ khi được hỏi trực tiếp bởi bạn bè đã quen thân. Vì mình không cần bạn tin những gì mình nói, và mình không cần ai gật gù công nhận mình nói đúng. Mình không có hứng thú ngồi cãi nhau tay đôi với một marketer nào trên đời xem ai đúng ai sai. TALK IS CHEAP. Tất cả đều sẽ là TRIED-AND-TRUE, tức là đã nói được phải làm được và chứng minh bằng kết quả thực tế.</span></p><p><span style=\"font-family: Arial;\"><b>3. BẠN NGHĨ BẠN LÀ MARKETER, THỰC RA BẠN CHỈ LÀ NGƯỜI TIÊU THỤ MÀ THÔI</b></span></p><p><span style=\"font-family: Arial;\">Ở Việt Nam, ngành marketing còn rất rất, rất mới. Mà cái gì mới quá thì dễ khiến người ta hoang mang. Mình ngán ngẩm thực sự khi thấy nhiều bạn cứ ngơ ngác đi đóng tiền mua vé để nghe mấy “bậc thầy ngành marketing” chém gió rồi về nghĩ rằng những cái đó sẽ giúp bạn kiếm tiền nhanh. Mà khổ, đọc ba cái mẩu quảng cáo pop-up ghi những câu như kiểu “Tôi sẽ dạy bạn bí quyết thành lập cỗ máy bán hàng tự động doanh thu 50,000 đô mỗi tháng mà bạn không cần làm gì cả” thế mà nhiều bạn cũng lao đầu mua vé đi nghe, lại còn nghĩ mình đang học để trở thành marketer giỏi, thì thua các bạn luôn. Nó đang làm marketing, đúng, nhưng không phải market để xây dựng thương hiệu gì sất, ngoài market chính mấy câu từ đó để lấy tiền vé của bạn thôi. Bạn nghĩ bạn là marketer nhưng bạn lại chẳng nhìn nổi ra chiêu marketing thô thiển của nó.</span></p><p><span style=\"font-family: Arial;\">Kinh nghiệm marketing thực ra gần gũi hơn bạn nghĩ rất nhiều. Đang lái xe tự nhiên thấy tấm biển “Bưởi da xanh” mà không thấy ai, bạn chậm lại nhìn, đi thêm 20m lại thấy tấm biển “Bưởi da xanh” nữa vẫn chả có ai, mà cách đó 20m nữa mới là ông nông dân đứng cạnh cái xe bán bưởi, thì hãy tấp vào để xem ổng bán bưởi cho bạn như thế nào. Cái đó chính là marketing chứ không gì xa xôi hết. Hãy luôn luôn quan sát xem tại sao trong menu nhà hàng thường có hình ảnh món ăn rất đẹp đi kèm, tại sao rạp phim chỉ thu thêm 1,000đ cho phần bắp rang lớn gấp đôi, tại sao đồ chơi trẻ con hay được bày dưới những ngăn thấp ở quầy tính tiền siêu thị, tại sao cái bài hát điện máy xanh kinh khủng lại cứ ám ảnh mãi không quên, tại sao nước hoa nam mà poster quảng cáo lại thấy toàn nữ, tại sao, tại sao, tại sao.</span></p><p><span style=\"font-family: Arial;\">Vì chỉ khi không ngừng quan sát và trả lời những câu hỏi tại sao, bạn mới có thể tìm thấy cơ hội trong marketing hiện đại.</span></p><p><span style=\"font-family: Arial;\">Máy thêu tên riêng lên mũ tại cửa hàng pop-up New Era ở chợ Bricklane, London. Theo bạn, tại sao họ lại mất tiền mất công đầu tư máy móc đắt tiền chỉ để thêu tên bạn lên vài cái mũ bán được trong một thời gian ngắn?</span></p><blockquote><p><span style=\"font-size: 16px;\"><b>LƯU Ý TO CUỐI BÀI</b></span></p></blockquote><p><span style=\"font-family: Arial;\">Mình đã ghi sơ phía trên nhưng xin lưu ý bạn thêm lần nữa, đây không phải tư liệu giáo dục, không phải “kinh nghiệm chuyên gia”, mà hoàn toàn chỉ là quan sát cá nhân để các bạn tham khảo. Bài viết này không nhằm tranh luận với ai, đúng sai được mất thế nào sẽ có thời gian và kết quả chứng minh. Mình thực sự yêu ngành marketing và nếu bạn cũng quyết định lựa chọn ngành này, xin chúc bạn cũng có tình yêu như thế.</span><br></p><br>', '0', '0', '1', '2021-12-26 12:06:59', '2021-12-26 14:48:52', 'nhung-dieu-truong-khong-day-ban-ve-marketing');
INSERT INTO `baiviet` (`MaBaiViet`, `HinhAnh`, `TieuDe`, `TenTag`, `NoiDung`, `LuotThich`, `BinhLuan`, `TrangThai`, `NgayTao`, `NgayCapNhat`, `DuongDan`) VALUES
(3, 'img/gioithieu/n-i-x-e-u-study-04-tt.jpg', '“Cho nó ổn định”', 'Câu chuyện', '<p><span style=\"font-family: Arial;\">Blog này được viết vì mình rất muốn nói chuyện với bạn nhiều hơn về một chuyện mình nhắc đến trong video – về SỰ ỔN ĐỊNH – cái thứ mà tròn méo ra sao chưa rõ nhưng có vẻ không bạn nào là chưa từng được bảo/khuyên/ép làm một số việc nhất định nhằm có được nó.</span></p><p><span style=\"font-family: Arial;\">Mình cũng chỉ là đứa trẻ con nên mình không dám đưa ra lời khuyên, nhưng nếu có một điều mình học được trong 26 năm qua, thì nó là thế này:</span></p><p><b><span style=\"font-family: Arial;\">“ỔN ĐỊNH” LÀ ẢO VỌNG KHÔNG CÓ THẬT</span></b></p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 1217.2px;\" data-filename=\"wl-op-34s.jpg\"><b><span style=\"font-family: Arial;\"><br></span></b></p><p><span style=\"font-family: Arial;\">Nó là ảo ảnh của những thế hệ đi trước mang theo kỳ vọng có thể úp luôn lên thế hệ đi sau. Bố mẹ bạn đẻ ra bạn và họ thương bạn hơn bất cứ ai, nhưng bản thân họ cũng vẫn có những vấn đề riêng của họ. Cuộc sống của họ đâu hoàn hảo, làm sao họ có thể dạy cho bạn về một lối đi hoàn hảo? Nhưng họ cảm thấy xót xa khi cái mông mềm xèo được bao bọc từ bé của bạn bị cuộc đời đá cho mấy cái, nên họ cố hướng bạn vào cái mà họ tin là “ổn định”. Và thường thì ảo vọng về sự “ổn định” được thành hình từ 2 yếu tố:</span></p><p><span style=\"font-family: Arial;\">Bạn có công việc ở một tổ chức “ổn định”, thường là cơ quan nhà nước, vì cái gì mang tính “nhà nước” nghe nó cũng vững chắc hơn, và hy vọng là sau khi bạn cống hiến cả đời thì nhà nước sẽ lo cho bạn. Nhưng từ từ đã nhé, nghĩ lại một tí. Bạn có nhớ 15 năm về trước, internet còn là cái thứ mà cả mình và bạn chỉ dám len lén trốn tiết ra tiệm net ngồi mò mẫm, chat chit và nhảy Audition? Cũng chưa quá lâu đúng không? Nhìn lại mình ngày hôm nay đi, cuộc đời bạn giờ chỉ có 3 thứ quan trọng nhất là cái máy bạn đang cầm để đọc cái bài này, con ghệ bạn quen qua Tinder và đôi sneaker mồi phiên bản limited edition bạn rình mãi mới mua được online. Hãy xem xem cả thế giới đã thay đổi như thế nào sau 15 năm ngắn ngủi. Bạn nghĩ khả năng một công việc ở cơ quan nhà nước vào thời điểm này sẽ cho bạn nguồn lương hưu “ổn định” vào 40 năm nữa là bao nhiêu phần trăm?</span></p><p><span style=\"font-family: Arial;\">Bạn lấy chồng/vợ sớm cho “ổn định”. Trả lời mình câu này, bạn mất bao nhiêu thời gian và công sức để hiểu một người? Ai cũng có thể xem chung bộ phim, uống chung ly nước và đi chung vài chuyến du lịch. Nhưng ý mình là thực sự hiểu ấy, hiểu từ vui đến buồn, từ lúc thuận lợi nhất đến lúc khó khăn nhất. Nếu chưa thực sự hiểu và thương nhau, mà lại muốn lấy cái tờ giấy chứng nhận hôn nhân để buộc anh ta/cô ta lại thì liệu đó là “ổn định” hay rủi ro? Thời này không còn như thời xưa nữa, bạn thừa biết bạn có nhiều sự lựa chọn và anh ta/cô ta cũng thế, một miếng giấy chứ 10 miếng giấy và ba chục đứa con cũng không giữ anh ta/cô ta lại với bạn được, nếu như điều quan trọng nhất trong mối quan hệ không còn nữa.</span></p><p><b><span style=\"font-family: Arial;\">SỐNG ĐỂ SỐNG HAY SỐNG ĐỂ CHO XONG?</span></b></p><p><span style=\"font-family: Arial;\">Bạn có biết hình ảnh bạn lao vào cuộc đua tìm kiếm sự “ổn định” cùng đám bạn bằng tuổi của bạn nó giống cái gì không? Nó giống như là bạn bắt đầu chơi game level 1 mà lại tìm code hack thẳng qua luôn cả phần đánh trùm để phá đảo cứu công chúa luôn cho xong ấy. Bạn mong được cái gì? Bạn muốn cuộc đời chúc mừng bạn vì bạn đã tua được qua mấy chục năm cuộc đời để phá đảo và “ổn định” à? Bạn có biết sau khi phá đảo cứu công chúa là gì không?</span></p><p><span style=\"font-family: Arial;\">Chính xác, chẳng là gì cả. Chẳng còn gì để làm. Không cảm xúc, không buồn, không vui, không thua, không thắng, không thất vọng và cũng không còn hy vọng. Bạn đã bỏ qua hết những điều tuyệt vời đáng nhẽ bạn được trải nghiệm trên đường đi.</span></p><p><span style=\"font-family: Arial;\">Khi đi học bạn ao ước được đi làm. Đi làm rồi bạn ráo riết kiếm người yêu. Có bồ rồi bạn giục giã đám cưới. Về nhà chồng bạn muốn có con ngay. Con bé bạn mong nó lớn thật nhanh. Bạn được sống một lần duy nhất, thực sự bạn muốn tua qua nó đến thế sao?</span></p><p><b><span style=\"font-family: Arial;\">BẠN MUỐN “ỔN ĐỊNH” KHÔNG?</span></b></p><p><span style=\"font-family: Arial;\">Bạn đừng nghĩ mình gạt hết tất cả những quan niệm về sự thăng bằng trong cuộc sống và phủ nhận mọi kinh nghiệm sống của thế hệ đi trước. Không có gì sai khi một người muốn sống một cuộc sống với cảm giác vững chãi, yên ổn. Mấu chốt ở đây là nếu bạn lấy sự ổn định của bản thân và dựa nó vào một nơi làm việc, hay một người (mà bạn nghĩ là) bạn đời, thì sự đổ gãy là khó tránh lắm.</span></p><p><span style=\"font-family: Arial;\">Bạn biết như thế nào là ổn định không? Là chính bạn với khả năng tự đứng vững về kinh tế và tình cảm, dù công việc hay hôn nhân hay cả thế giới có sụp đổ ngay trước mắt. Cuộc đời không phải vạch đích “ổn định” đâu bạn, mà là những buồn vui trên đường đi. Nếu bạn thực sự sợ cảm giác “không ổn định”, thì mình có gợi ý này cho bạn. Bạn biết cái gì còn kinh khủng hơn cảm giác bấp bênh không? SỰ NUỐI TIẾC.</span></p>', '0', '0', '1', '2021-12-26 12:33:51', '2021-12-26 13:30:46', 'cho-no-on-dinh');

