INSERT INTO `gioithieu` (`MaGioiThieu`, `HinhAnh1`, `HinhAnh2`, `HinhAnh3`, `CongViec`, `GioiThieuNgan`, `MoTa`) VALUES
(1, 'img/gioithieu/1988f2f0503a9a64c32b.jpg', 'img/gioithieu/ebaa7a56d89c12c24b8d.jpg', 'img/gioithieu/6b3d554a479b8dc5d48a.jpg', 'Blogger / Luật / Kinh doanh bất động sản', '<p style=\"\"><span style=\"color: rgb(69, 69, 69); font-family: \" times=\"\" new=\"\" roman\";=\"\" font-size:=\"\" 15px;\"=\"\"><i>Mình là Thanh Thùy, là một Blogger, hiện mình đang sống và làm việc cho một công ty bất động sản tại Huế ^^</i></span></p>', '<p><span style=\"font-family: Arial;\">Tính đến thời điểm blog này được viết, mình đã làm trong ngành marketing được gần 2 năm. Đây là một thời gian không dài và mình còn rất rất, rất nhiều thứ phải học, nhưng mình rất hào hứng. Công nghệ và mạng internet đã đưa ngành marketing đến một thời kỳ mà mọi thứ đều thay đổi nhanh chóng và tất cả những phương pháp từng đúng trước đây trở nên khác đi. Và mình thực sự hào hứng khi liên tục được thử nghiệm, rút kinh nghiệm, thử nghiệm rồi lại rút kinh nghiệm để tìm cách làm chủ được sự vận động đó.</span></p><p><span style=\"font-family: Arial;\">Tốt nghiệp đại học ngành Fashion Design & Technology, mình ra trường và trở thành Phóng viên Thời Trang/Stylist cho một tạp chí. Gần 2 năm làm việc ở đây, công việc của mình gắn liền với chụp ảnh thời trang, viết bài, phỏng vấn người nổi tiếng, các sự kiện quảng bá và quan hệ với các thương hiệu. Những điều này đã cho mình một nhận thức thực tế về marketing, thương hiệu, hình ảnh, dư luận, truyền thông, và sự ham thích của mình với ngành marketing cũng bắt đầu từ đây.</span></p><p><span style=\"font-family: Arial;\">Làm tạp chí được gần 2 năm, mình quyết định nghỉ việc để đi học thạc sĩ ngành Fashion Marketing. Đây là thời gian để mình học về những khái niệm và quy trình cơ bản trong ngành marketing, nghe kinh nghiệm của các chuyên gia trong ngành, quan sát và tìm hiểu về các thương hiệu ở đất nước đang học. Sau khi tốt nghiệp, mình quay lại Sài Gòn và trở thành con mọt marketing. Trong tuần mình đi làm công việc marketing, cuối tuần viết blog, làm video, lên ý tưởng về nội dung, thời gian rảnh mình đọc và nghe thông tin về các nhãn hàng, mạng xã hội, những làn sóng mới trong tiêu thụ và đời sống. Marketing không phải tiếp thị. Marketing không phải quảng cáo. Marketing là văn hoá, là thói quen, là cuộc sống của mình.</span></p><p><span style=\"font-family: Arial;\">Và bài viết này là để chia sẻ với bạn những điều không được dạy ở trường, những điều mình quan sát được, những điều mình suy nghĩ.</span></p><p><span style=\"font-family: Arial;\">Tính đến thời điểm blog này được viết, mình đã làm trong ngành marketing được gần 2 năm. Đây là một thời gian không dài và mình còn rất rất, rất nhiều thứ phải học, nhưng mình rất hào hứng. Công nghệ và mạng internet đã đưa ngành marketing đến một thời kỳ mà mọi thứ đều thay đổi nhanh chóng và tất cả những phương pháp từng đúng trước đây trở nên khác đi. Và mình thực sự hào hứng khi liên tục được thử nghiệm, rút kinh nghiệm, thử nghiệm rồi lại rút kinh nghiệm để tìm cách làm chủ được sự vận động đó.</span></p><p><span style=\"font-family: Arial;\">Tốt nghiệp đại học ngành Fashion Design & Technology, mình ra trường và trở thành Phóng viên Thời Trang/Stylist cho một tạp chí. Gần 2 năm làm việc ở đây, công việc của mình gắn liền với chụp ảnh thời trang, viết bài, phỏng vấn người nổi tiếng, các sự kiện quảng bá và quan hệ với các thương hiệu. Những điều này đã cho mình một nhận thức thực tế về marketing, thương hiệu, hình ảnh, dư luận, truyền thông, và sự ham thích của mình với ngành marketing cũng bắt đầu từ đây.</span></p><p><span style=\"font-family: Arial;\">Làm tạp chí được gần 2 năm, mình quyết định nghỉ việc để đi học thạc sĩ ngành Fashion Marketing. Đây là thời gian để mình học về những khái niệm và quy trình cơ bản trong ngành marketing, nghe kinh nghiệm của các chuyên gia trong ngành, quan sát và tìm hiểu về các thương hiệu ở đất nước đang học. Sau khi tốt nghiệp, mình quay lại Sài Gòn và trở thành con mọt marketing. Trong tuần mình đi làm công việc marketing, cuối tuần viết blog, làm video, lên ý tưởng về nội dung, thời gian rảnh mình đọc và nghe thông tin về các nhãn hàng, mạng xã hội, những làn sóng mới trong tiêu thụ và đời sống. Marketing không phải tiếp thị. Marketing không phải quảng cáo. Marketing là văn hoá, là thói quen, là cuộc sống của mình.</span></p><p><span style=\"font-family: Arial;\">Và bài viết này là để chia sẻ với bạn những điều không được dạy ở trường, những điều mình quan sát được, những điều mình suy nghĩ.</span></p>');

